import React from 'react';
import styles from './AddUser.module.css';
import Card from './Card';
import Button from './Button';

const AddUser = () => {
    return (
        <Card>
            <label htmlFor="username" className={styles.input.label}>Username</label>
            <input id="username" type="text" className={styles.input}></input>

            <label htmlFor="age" className={styles.input.label}>Age (Years)</label>
            <input id="age" type="number" className={styles.input}></input>

            <Button type="submit"></Button>
        </Card>
    )
};

export default AddUser;
